ssories                    | Networking               |\n      | Smart Home  | Smart Home Lightning           | Plugs and Outlets        |\n      | Sports      | Athletic Clothing              | Exercise & Fitness       |\n      | Automative  | Automative Parts & Accessories | MotorCycle & Powersports |\n\n  @addToCart\n  Scenario: Verify User can add an item to cart\n    And User change the category to 'Smart Home'\n    And User search for an item 'Kasa outdoor smart plug'\n    And User click on Search icon\n    And User click on item\n    And User select quantity '2'\n    And User click add to Cart button\n    Then the cart icon quantity should change to '2'\n\n  @placeOrder\n  Scenario: Verify User can place an order without Shipping address and payment Method on file\n    And User change the category to 'Smart Home'\n    And User search for an item 'kasa outdoor smart plug'\n    And User click on Search icon\n    And User click on item\n    And User select quantity '2'\n    And User click add to Cart button\n    Then the cart icon quantity should change to '2'\n    And User click on Cart option\n    And User click on Proceed to Checkout button\n    And User clicks Add a new address link for shipping address\n    And User fills new address form with below information\n      | country | fullName | PhoneNumber | StreetAddress | apt | city | state | zipCode |\n    ##   And User click Add Your Address button\n    And User click Add a credit card or Debit Card for Payment method\n    And User fills Debit or credit card information\n      | cardNumber | nameOnCard | expirationMonth | expirationYear | securityCode |\n      |            |            |               5 |           2025 |          525 |\n    ## And User click on Add your card button\n    And User click on Place Your Order\n    Then order message should be displayed 'Order Placed, Thanks'\n\n  @placeOrderWith\n  Scenario: Verify User can place an order with Shipping address and payment Method on file\n    And User changes category to 'Electronics'\n    And User search for an item 'Apex Legends'\n    And User click on Search icon\n    And User click on item\n    And User select quantity '5'\n    And User click add to Cart button\n    Then the cart icon quantity should change to '5'\n    And User click on Cart option\n    And User click on Proceed to Checkout button\n    And User click on Place Your Order\n    Then order message should be displayed 'Order Placed, Thanks'\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:features/RetailHome.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@test","id":"cd3cfae4-db48-4cf2-8226-906acccbfeff"}],"language":"en","keyword":"Feature","name":"This feature is use for testing UI of Retail page","description":"","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"User is on retail website","id":"bdbb258b-a3d9-4405-8f52-185e16e2298b"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"User click on Sign in option","id":"fe09af01-847b-4e3c-b254-64dabf17f80a"},{"location":{"line":7,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User enter email 'ramin@gmail.com' and password 'Tek@1234567'","id":"99a9fc9a-b06f-4b62-86cc-9f17ea7dda25"},{"location":{"line":8,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User click on login button","id":"4b8cad0e-9f71-49ec-a895-3e65404f0181"},{"location":{"line":9,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User should be logged into the Account","id":"216d6e17-ffbe-494c-82dd-97240c1aed29"}],"id":"1163d6ab-3b89-4995-9bda-96ce3b9415a8"}},{"scenario":{"location":{"line":12,"column":3},"tags":[{"location":{"line":11,"column":3},"name":"@searchProduct","id":"6bc67a9d-4235-49a3-9bf8-3db
